import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import add from './images/add.png';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup,
  Carousel, CloseButton, DropdownButton, Dropdown
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';

function App() {


  return (
    <div className="App">
      <Dropdown as={ButtonGroup}>
        <Dropdown.Toggle id="dropdown-custom-1">Pow! Zoom!</Dropdown.Toggle>
        <Dropdown.Menu className="super-colors">
          <Dropdown.Item eventKey="1">Action</Dropdown.Item>
          <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
          <Dropdown.Item eventKey="3" active>
            Active Item
          </Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>{' '}
      <Dropdown as={ButtonGroup}>
        <Button variant="info">mix it up style-wise</Button>
        <Dropdown.Toggle split variant="success" id="dropdown-custom-2" />
        <Dropdown.Menu className="super-colors">
          <Dropdown.Item eventKey="1">Action</Dropdown.Item>
          <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
          <Dropdown.Item eventKey="3" active>
            Active Item
          </Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    </div>
  );
}

export default App;
